import React from 'react';
import { Link } from 'react-router-dom';
import styles from './RightCont.module.css'

function RightCont() {
  return (
    <>
      <div className={styles.mainalbum}>
        <div className={styles.mainAlbumName}>
          <Link>READY TO BE</Link>
        </div>
        <div></div>
      </div>
    </>
  );
}

export default RightCont;
